export const requestGet = async(path) => {

    fetch(path)
        //  .then((result) => {
        //     return result.json;
        //  })
        .then((res) => res.json())

         .then((data) => {
           const result = data
           return result
         })
         .catch((err) => {
            console.log(err.message);
         });
}
